	/*Eliminación de registro*/
	$scope.eliminar = function(agno, mes, dia, id, titulo, volumen){
		if(confirm('Confirme la eliminación de este registro:\n' + titulo + ' #' + volumen))
		{
			var eliminado = false;
			var precio = 0;
			angular.forEach($scope.$storage.registros[agno][mes][dia], function(value, key){
				if(!eliminado && value.id == id)
				{
					precio = value.precio;
					$scope.$storage.registros[agno][mes][dia].splice(key, 1);
					eliminado = true;
				}
			});
			
			//Eliminar fechas vacías
			if(eliminado)
			{
				if($scope.objsize($scope.$storage.registros[agno][mes][dia]) === 0) delete $scope.$storage.registros[agno][mes][dia];
				if($scope.objsize($scope.$storage.registros[agno][mes]) === 0) delete $scope.$storage.registros[agno][mes];
				if($scope.objsize($scope.$storage.registros[agno]) === 0)
				{
					delete $scope.$storage.registros[agno];
				
					//Si no hay año, seleccionar año disponible
					if($scope.objsize($scope.$storage.registros) > 0) $scope.pestanaAgnoActivo($scope.keysReversed($scope.$storage.registros)[0]);
				}
				
				$scope.sumar(agno, mes, dia, -precio);
			}
			else alert('Ha ocurrido un error. Intente de nuevo más tarde.');
		}
		else $('.clicking').removeClass('clicking');
	};
	
	//FORMULARIO
	/*Registrar. Validar y toda la cosa.*/
	$scope.registrar = function(desdeMisComics) {
		if(angular.isUndefined(desdeMisComics)) desdeMisComics = false;
		if(!desdeMisComics) $scope.nuevo.titulo = $('#nuevo_titulo').val(); //Reparar valores del arreglo $scope.nuevos. Corta los valores del título y no sé porqué :(
		if($scope.nuevo.titulo.length > 0 && $scope.nuevo.volumen !== null && $scope.nuevo.precio !== null)
		{
			$scope.nuevo.id = code($scope.nuevo);
			$scope.nuevo.fecha = new Date($scope.nuevo.fecha);
			var nuevoAgno = $filter('date')(new Date($scope.nuevo.fecha), 'yyyy');
			var nuevoMes = $filter('date')(new Date($scope.nuevo.fecha), 'MM');
			var nuevoDia = $filter('date')(new Date($scope.nuevo.fecha), 'dd');
			
			//Verificar que no esté duplicado
			var repetido = false;
			var repetido_info;
			angular.forEach($scope.$storage.registros, function(meses, key_agno) {
				angular.forEach(meses, function(dias, key_mes) {
					angular.forEach(dias, function(registros, key_dia) {
						angular.forEach(registros, function(registro, key) {
							if(!repetido && registro.id == $scope.nuevo.id)
							{
								repetido = true;
								repetido_info = registro;
							}
						});
					});
				});
			});
			
			//Insertar
			if(!repetido)
			{
				if(typeof $scope.$storage.registros == 'undefined') $scope.$storage.registros = {};
				if(typeof $scope.$storage.registros[nuevoAgno] == 'undefined') $scope.$storage.registros[nuevoAgno] = {};
				if(typeof $scope.$storage.registros[nuevoAgno][nuevoMes] == 'undefined') $scope.$storage.registros[nuevoAgno][nuevoMes] = {};
				if(typeof $scope.$storage.registros[nuevoAgno][nuevoMes][nuevoDia] == 'undefined') $scope.$storage.registros[nuevoAgno][nuevoMes][nuevoDia] = [];
				
				//Fecha de registro
				$scope.nuevo.fecha_registro = (typeof $scope.nuevo.fecha_registro == 'undefined') ? new Date() : new Date($scope.nuevo.fecha_registro);
				$scope.nuevo.fecha_adquisicion = ($scope.nuevo.adquirido == 1) ? $scope.nuevo.fecha_registro : 'No definido';
				// c($scope.nuevo);
				
				$scope.$storage.registros[nuevoAgno][nuevoMes][nuevoDia].push($scope.nuevo);
				$scope.sumar(nuevoAgno, nuevoMes, nuevoDia, $scope.nuevo.precio);
				
				//TypeAhead
				$scope.typeOptions.push($scope.nuevo.titulo);
				$scope.typeAheadSet();
				
				$scope.nuevo = vacio();
				$('#nuevo_titulo').val($scope.nuevo.titulo); //Setear valor del campo de título, que no se refresca :(
				// c($scope.nuevo);
				
				// $scope.typeAheadGenerateOptions();
			}
			else //Está duplicado
			{
				var conVariante = ($scope.nuevo.variante.length > 0) ? ' (Variante de ' + $scope.nuevo.variante + ')' : '';
				alert('Wow wow wow!\n¡Este ya lo tienes!\n' + $scope.nuevo.titulo + conVariante + ' #' + $scope.nuevo.volumen + ' ($' + repetido_info.precio + '.00)\n' + $filter('date')(repetido_info.fecha, 'longDate'));
			}
		}
	};

