	/*Opciones del TypeAhead*/
	//Indexador de títulos
	$scope.typeAheadGenerateOptions = function(){
		$scope.typeOptions = [];		
		angular.forEach($scope.$storage.registros, function(meses, key_agno) {
			angular.forEach(meses, function(dias, key_mes) {
				angular.forEach(dias, function(registros, key_dia) {
					angular.forEach(registros, function(registro, key) {
						if($scope.typeOptions.indexOf(registro.titulo) == -1) $scope.typeOptions.push(registro.titulo);
					});
				});
			});
		});
	};
	
	//Buscador
	$scope.matcher = function (item, query) { if (item.toLowerCase().indexOf(query.trim().toLowerCase()) != -1) return true; };

	//Asignar el typeAhead
	$scope.typeAheadSet = function(){
		$('.typeAhead').typeahead('destroy');
		$('.typeAhead').typeahead({
			minLength: 3,
			hint: false,
			highlight: false
		},
		{
			name: 'states',
			displayKey: 'value',
			source: function (query, process) {
				var states = [];
				$.each($scope.typeOptions, function (i, state) {
					if(states.length < 5 && $scope.matcher(state, query)) states.push({value: state});
				});
				process(states);
			},
		}).blur(function(){ $(this).val($.trim($(this).val().toUpperCase())); });
	};
	
